import NavBarStaff from './NavBarStaff';
import { useState, useEffect } from "react";
import { Link, useNavigate, useLocation } from 'react-router-dom';

const StaffSetLoyaltyStatus = () => {
    
    const [searched, setsearched] = useState(0);
    const [LoyaltyTransaction, setLoyaltyTransaction] = useState([]);
    const [isPending, setIsPending] = useState(false);
    const [id2, setId] = useState(0);
    const [item, setitem] = useState('');
    const location = useLocation();
    const history = useNavigate();

    const handleSubmit = (e) =>{
        e.preventDefault()
        fetch('http://localhost:8003/loyaltytransaction')
         .then(res =>{
             return res.json();
         })
         .then(data => {
             console.log(data);
             setLoyaltyTransaction(data);
         });     
             console.log(searched)
             setIsPending(true);
                // console.log(xtype(parseInt(searched)));
    }

    const handleSubmit2 = (e) => {
        e.preventDefault()
        console.log(id2);
        const status ="Completed"
        fetch(`http://localhost:8003/loyaltytransaction/${id2}`) 
        .then(res=>{
            return res.json();
         })
        .then(data => {
            // console.log(data)
            // console.log(data.item)
            // setitem(data.item)
            console.log(data)

            fetch(`http://localhost:8003/loyaltytransaction/${id2}`,
            {
                method: 'PUT',
                headers: {"Content-Type": "application/json"},
                body: JSON.stringify({...data, itemstatus : status})
            }) 

            console.log("update successfully")
            console.log("refresh page")
            history(0)   

        });  
    }

    const tableStyles = {
        borderCollapse: 'collapse',
        width: '100%',
        backgroundColor: '#f9f9f9',
        color: '#444'
    }
    
    const tableHeaderStyles = {
        backgroundColor: '#333',
        color: '#fff',
        fontWeight: 'bold'
    }
    
    const tableDataStyles = {
        textAlign: 'left',
        padding: '8px'
    }

    const alternatingRowStyles = {
        backgroundColor: '#f2f2f2'
    }

    return ( 
        <>
        <NavBarStaff />
        
        <div>
            <h1>Update Loyalty Status</h1>
            <form onSubmit={handleSubmit}>
                <table>
                    <tr>
                        <td><label>Search Transaction History using id:</label></td>
                        <td><input type="text" value={searched} onChange={(e) => setsearched(e.target.value)}></input><button>Search</button></td>
                        
                    </tr>          
                </table>
            </form>
            
            <form onSubmit={handleSubmit2} style={{margin: '20px'}}>
                <table style={tableStyles}>
                    <thead>
                        <tr style={tableHeaderStyles}>
                            <th style={tableDataStyles}>Transaction ID</th>
                            <th style={tableDataStyles}>Customer ID</th>
                            <th style={tableDataStyles}>Item Name</th>
                            <th style={tableDataStyles}>Item Status</th>
                            <th style={tableDataStyles}>Submit to confirm claim</th>
                        </tr>
                    </thead>
                    <tbody>
                        {isPending && LoyaltyTransaction.filter(records => records.id === parseInt(searched)).map(record =>(
                        <tr id={record.key}>
                            <td style={tableDataStyles}>{record.id}</td>
                            <td style={tableDataStyles}>{record.customerid}</td>
                            <td style={tableDataStyles}>{record.item}</td>
                            <td style={tableDataStyles}>{record.itemstatus}</td>
                            <td style={tableDataStyles}><button className="w3-button w3-light-grey w3-round-large" value={record.id} onClick={(e)=> setId(e.target.value)}>Submit</button></td>
                        </tr>
                        ))}    
                    </tbody>     
                </table>
            </form>
        </div>
        </>
     );
}
 
export default StaffSetLoyaltyStatus;
